import * as React from "react";
import { useParams } from "react-router-dom";

import { useState, useEffect } from "react";

function Task() {


  // Get ID from URL
  const params = useParams();

  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios
      .get(`http://localhost:5000/posts/${params.id}`)
      .then((res) => {
        console.log(res);
        setPosts(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [params.id]);
}

export default Task;
